import React from "react";
import "./Home.css";
export default function Home() {
  return (
    <>
      <div className="firstcontainer">
          <div className="titlecontainer">
            <p className="title">KRap Game</p>
          </div>
          <div className="subtitle">
            <p>Select Your Game</p>
          </div>
      </div>
    </>
  );
}
